import React from "react";

export default function Footer() {
  return (
    <>
      <div className="fluid-container bg-warning w-100 text-dark mt-4 pt-4 pb-2">
        <div className="row justify-content-evenly">
          <div className="col-6">
            <h3 className="text-start">College Fun</h3>
          </div>
          <div className="col-6">
            <h6 className="text-muted text-end mt-2">
              | copyrights@collegefun2022
            </h6>
          </div>
        </div>
      </div>
    </>
  );
}
